(function() {
    angular.module('plUploadModule', ['ngCookies'])
        .provider('plUploadProvider', plUploadProvider)
        .directive('plUpload', ['plUploadProvider', '$q', '$parse', '$http', '$timeout', function(plUploadProvider, $q, $parse, $http, $timeout) {
            function getOSSSecurityToken() {
                var deffer = $q.defer();
                $http.get('../api/admin/oss/sts').then(function(res) {
                    if (res.data && res.data.credentials) {
                        deffer.resolve(res.data.credentials);
                    } else {
                        deffer.reject('get oss security token failed');
                    }
                });
                return deffer.promise;
            }              
            return {
                restrict: 'EA',
                transclude: true,
                template: '<div ng-transclude></div>',
                link: function(scope, elements, attrs) {
                    var serverType = attrs.uploaderType || 'oss'; //上传类型['oss'(default), 'customize']
                    var urlInResponse = attrs.urlInResponse; //上传接口返回url ？
                    //手动获取上传后的图片地址,返回值为promise, urlInResponse = true 或 uploaderType = 'oss'可不设置
                    var fetchPathFn = plUploadProvider.config.fetchPathFn || $parse(attrs.fetchPathFn)(scope.$parent) || angular.noop;
                    var html = elements[0].innerHTML;
                    var autoStart = attrs.autoStart == 'false' ? false : true;
                    var fileQueue = attrs.fileQueue ? $parse(attrs.fileQueue) : null;
                    var manuallyStartFn = attrs.manuallyStartFn ? $parse(attrs.manuallyStartFn) : angular.noop;
                    var multi_selection = attrs.multi == 'true' ? true : false;
                    var customeParams = attrs.params ? $parse(attrs.params)(scope.$parent) : {}; 
                    if (serverType == 'oss') var tokenPromise = getOSSSecurityToken(); //默认是阿里云直传方式的

                    ////==============阿里云上传参数准备===================
                    var ossInitPromise = tokenPromise.then(function(credentials) {
                        var policyText = {
                            "expiration": credentials.Expiration,
                            "conditions": [
                                ["content-length-range", 0, 1048576000] // 上传文件的大小限制
                            ]
                        }
                        var accessid= credentials.AccessKeyId;
                        var accesskey= credentials.AccessKeySecret;
                        var host = 'http://princewck.oss-cn-shanghai.aliyuncs.com';
                        var policyBase64 = Base64.encode(JSON.stringify(policyText));
                        var bytes = Crypto.HMAC(Crypto.SHA1, policyBase64, accesskey, { asBytes: true }) ;
                        var signature = Crypto.util.bytesToBase64(bytes);
                        var new_multipart_params = {
                            'Filename':'kamll/${filename}',
                            'key':'img/'+Math.uuid().replace(/-/g,'').toLowerCase(),
                            'policy': policyBase64,
                            'OSSAccessKeyId': accessid,
                            'success_action_status' : '200', //让服务端返回200,不然，默认会返回204
                            'x-oss-security-token' : credentials.SecurityToken,
                            // 'success_action_redirect': "" //上次成功后客户端跳转到的URL
                            'signature': signature              
                        };
                        var defer = $q.defer();
                        defer.resolve({
                            host: host,
                            accessid: accessid,
                            accesskey: accesskey,
                            policyBase64: policyBase64,
                            bytes: bytes,
                            signature: signature,
                            multi_selection: true,
                            new_multipart_params: new_multipart_params,
                            getCustomizedInitPromiseFn: function(up, file, res) {
                                return 'http://princewck.oss-cn-shanghai.aliyuncs.com/img/' + file.uuid;
                            }
                        });
                        return defer.promise;
                    });
                    
                    //==============自定义上传准备===================
                    var customizedInitPromise = plUploadProvider.config.getCustomizedInitPromiseFn();

                    ////==============上传组件实例化===================
                    if (serverType == 'oss') {
                        ossInitPromise.then(function(params) {
                           initUploader(params);
                        });                        
                    } else {
                        customizedInitPromise.then(function(params) {
                            initUploader(params);
                        });
                    }

                    function initUploader(params) {
                        angular.extend(params.new_multipart_params, customeParams);
                        var configs = {
                            runtimes : 'html5,flash,silverlight,html4',
                            browse_button : elements[0], //DOM or id
                            max_file_size : '10mb',
                            multi_selection: params.multi_selection || false,
                            multipart_params: params.new_multipart_params,
                            url: params.host,
                            flash_swf_url : 'http://rawgithub.com/moxiecode/moxie/master/bin/flash/Moxie.cdn.swf',
                            silverlight_xap_url : 'http://rawgithub.com/moxiecode/moxie/master/bin/silverlight/Moxie.cdn.xap',
                            filters : [ //接受的文件类型
                                {title : "Image files", extensions : "jpg,jpeg,gif,png"}
                            ],
                            init: {
                                PostInit: function(up) {
                                    console.log('%cuploader init success ![id:'+ up.id +']', 'font-size:12px;color:darkgreen;');
                                },
                                FilesAdded: function(up, files) {
                                    fileQueue && scope.$apply(
                                        fileQueue.assign(scope.$parent, up.files.filter(function(file) {
                                            return file.percent < 100;
                                        }))
                                    );
                                    autoStart && uploader.start();
                                },
                                BeforeUpload: function(up, file) {
                                    file.uuid = Math.uuid().replace(/-/g,'').toLowerCase();
                                    up.settings.multipart_params.key = "img/"+file.uuid;
                                },
                                UploadProgress: function(up, file) {
                                    var percent = 0;
                                    up.files.forEach(function(file) {
                                        percent += file.percent;
                                    });
                                    scope.$apply(scope.progress = Math.floor(percent/(up.files.length)));
                                },
                                fileUploaded: function(up , file, data) {
                                    var defer = $q.defer();
                                    defer.resolve(plUploadProvider.config.getUrl);
                                    // fetchPathFn 返回一个promise对象 资源的地址(文件名前面那一段,结尾不带｀/｀)
                                    //todo fullfill the logic later;
                                    var promise = serverType == 'oss' ?defer.promise : fetchPathFn(up, file, data);
                                    promise.then(function(url) {
                                        console.log(url +'/img/' + file.uuid);
                                        scope.images.push(url +'/img/' + file.uuid);
                                    });
                                    // scope.images.push(params.getCustomizedInitPromiseFn(up , file, data));
                                    if (fileQueue) fileQueue.assign(scope.$parent, up.files.filter(function(file) {
                                        return file.percent < 100;
                                    }));
                                },
                                UploadComplete: function(uploader, files) {
                                    $timeout(function() {
                                        scope.progress = 0;
                                    }, 1500);
                                },
                                Error: function(up, err) {
                                    console.error(err);
                                }
                            }
                        };
                        if (params.file_data_name) {configs.file_data_name = params.file_data_name};
                        var uploader = new plupload.Uploader(configs);
                        uploader.init();
                        scope.startUpload = function(){
                            uploader.start();
                        };  
                        var oldStartFn = manuallyStartFn(scope.$parent);
                        try {
                            manuallyStartFn.assign(scope.$parent, function() {
                                //把外面$scope上的方法包装起来，并添加广播行为，以监听触发上传
                                oldStartFn();
                                scope.$parent.$broadcast(uploader.id, 'test');
                            });
                        } catch (e) {
                            if (!autoStart) console.warn('%cmanuallyStartFn 未指定, \n1.请在指令属性中加入manually-start-fn="[fn]";  \n2.在父层scop定义fn方法; \n3.并在任意位置添加手动上传按钮<button ng-click="fn()"> \n* fn中可不执行操作:fn = new Function()即可',
                                    'color:red;font-weight:bold');
                        }
                        scope.$on(uploader.id, function(data) {
                            if (uploader.files.filter(function(file) {
                                return file.percent < 100;
                            }).length < 1) return new Function('console.log(\'没有可上传图片\')')();
                            uploader.start();
                        });   

                        //queue的变化同步到uploader实例                     
                        scope.$watch('getQueue()', function(n) {
                            uploader.files.forEach(function(file, index) {
                                var exist = n.some(function(f) {
                                    return f.id == file.id;
                                });
                                if (!exist) uploader.files.splice(index, 1);
                            });                        
                        }, true);

                        scope.getQueue = function() {
                            return fileQueue(scope.$parent);
                        }                         
                    }
                },
                scope: {
                    progress: '=',
                    images: '=',
                }
            }
        }])
        .directive('plUploadCommon', function($timeout) {
            return {
                restrict: 'AE',
                templateUrl: './vendor/fileUploader/src/template-bootstrap.html',
                scope: {
                    images: '=',
                    showQueue: '@',
                    multi: '@',
                    fetchUrlFn: '&',
                    autoStart: '@'
                },
                link: function(scope) {
                    scope.fileQueue = [];
                    var showQueue = scope.showQueue == 'true' ? true : false;
                    scope.manuallyStartFn = function(){};

                    scope.getQueuePanelWidth = function() {
                        return 250 * Number(Boolean(scope.fileQueue.length) && showQueue);
                    }

                    scope.shortName = function(name) {
                        if (name.length > 20) 
                            return name.substring(0,17) + '...';
                        return name;
                    }

                    scope.autoStart = scope.autoStart == 'true' ? true : false;
                    scope.autoStartBtn = scope.autoStart ? false : true;

                    scope.queeRm = function(index) {
                        $timeout(function(){scope.fileQueue.splice(index, 1)},0);
                    }

                    scope.delImg = function(index) {
                        scope.images.splice(index, 1);
                    }

                    scope.mv = function(index, direction) {
                        var index2 = index + parseInt(direction);
                        var images = scope.images;
                        var temp = scope.images[index2];
                        scope.images[index2] = scope.images[index];
                        scope.images[index] = temp;
                        scope.images = angular.copy(scope.images);
                    }
                }
            }
        })
        .directive('lazyLoadImg', function() {
            //图片懒加载
            return {
                restrict: 'AE',
                replace: true,
                template: '<img height="{{ height }}" src="'+ getLoadingPic() +'">',
                scope: {
                    url: '@',
                    height: '@'
                },
                link: function(scope, elements) {
                    var image = new Image();
                    image.onload = function() {
                        console.log('图片加载完毕');
                        elements[0].src = scope.url;
                    }
                    image.src = scope.url;
                }
            }
        });

    function plUploadProvider() {
        var config = {
            putUrl: '',
            getUrl: 'http://princewck.oss-cn-shanghai.aliyuncs.com',
            urlOnPut: false,//put接口会返回url?
            getCustomizedInitPromiseFn: new Function()
        };
        this.config = function(conf) {
            if (conf.putUrl) config.putUrl = conf.putUrl;
            if (conf.getUrl) config.getUrl = conf.getUrl;
            if (conf.urlOnPut) config.urlOnPut = conf.urlOnPut;
        }

        this.setGetCustomizedInitPromiseFn = function(fn) {
            config.getCustomizedInitPromiseFn = fn;
        }
        this.$get = ['$q', '$cookies', function($q, $cookies) {
            function getCustomizedInitPromise() {
                var defer = $q.defer();
                var params = {
                    host: '../api/admin/upload/image',
                    file_data_name: 'uploadFile', //上传文件的key
                    new_multipart_params: {
                        'F-Session': $cookies.get('sessionToken')
                    },
                    multi_selection: true,
                    getCustomizedInitPromiseFn: function(up, file, res) {
                        //怎么获取上传的图片
                        console.log(res);
                        return '1234567';
                    }
                }
                defer.resolve();
                return defer.promise;
            }
            config.getCustomizedInitPromiseFn = getCustomizedInitPromise;
            return {config: config};
        }];
    }

    function getLoadingPic() {
        return 'data:image/gif;base64,';
    }
})();